import Layout from '../components/layout/layout';
import '../style/main.scss'
const App = ()=>{
    return(
        <Layout>
        <React.Fragment>
            <h1>My Landing</h1>
            <h2 className="main_headingclass">rwerwe</h2>
        </React.Fragment>
        </Layout>
    )
}
export default App;
